import React from 'react'
import SaleSmall from "../sales/salesmall";
import SalePerson from "../sales/salesperson";
function Saleindividual() {
    return (
        <section className="content">
            <div className="row">
                <div className={this.state.active ? 'col-2' : 'none'}>
                    <SaleSmall />
                </div>
                <div className={this.state.active ? 'col-10' : 'none'}>
                    <Route path={"/sale/salesperson"} component={SalesPerson} />
                </div>
            </div>
        </section>
    )
}

export default Saleindividual
